import "./Header.css";


const Header = () => {
  return (
    <header className="showcase">
        <div className="shaowcase-top" >
            <img src="https://cdn.cookielaw.org/logos/dd6b162f-1a32-456a-9cfe-897231c7763c/4345ea78-053c-46d2-b11e-09adaef973dc/Netflix_Logo_PMS.png" alt="logo" />
            <Link to="/" className="btn btn-rounded">
                Sign In
            </Link>
            </div>
            <div className="showcase-content">
                <h1> Unlimited movies, TV shows and more</h1>
                <p>Watch anywhere. Cancel Anytimes</p>
                <Link to="/netflixshow" className="btn btn-x1">
                    Watch Free For 30 Days
                    <i className="fas fa-chevron-right btn-icon"></i>
                </Link>
                </div>
    </header>

    
  );
};

export default Header
